### Summary of Core Topics, Concepts, Principles, and Equations

#### Core Topics and Concepts

1. **Random Variables**
   - **Discrete Random Variables**: Uniform, Bernoulli, Binomial, Geometric, Poisson.
   - **Continuous Random Variables**: Uniform, Exponential, Normal, Gamma, Beta.

2. **Probability Distributions**
   - **Probability Mass Function (PMF)**: For discrete random variables.
   - **Probability Density Function (PDF)**: For continuous random variables.
   - **Cumulative Distribution Function (CDF)**: For both discrete and continuous random variables.

3. **Expectation and Variance**
   - **Expected Value (Mean)**: \( E[X] \)
   - **Variance**: \( \text{Var}(X) \)

4. **Joint Probability Distributions**
   - **Joint PMF/PDF**: For two or more random variables.
   - **Marginal Distributions**: Derived from joint distributions.
   - **Conditional Probability**: \( P(X | Y) \)

5. **Inequalities**
   - **Markov’s Inequality**: \( P(X \geq c) \leq \frac{\mu}{c} \)
   - **Chebyshev’s Inequality**: \( P(|X - \mu| \geq k\sigma) \leq \frac{1}{k^2} \)

6. **Special Distributions**
   - **Binomial Distribution**: \( X \sim \text{Binomial}(n, p) \)
   - **Poisson Distribution**: \( X \sim \text{Poisson}(\lambda) \)
   - **Normal Distribution**: \( X \sim \text{Normal}(\mu, \sigma^2) \)

#### Important Equations

1. **Expected Value and Variance for Common Distributions**
   - **Uniform (Discrete)**: \( E[X] = \frac{a+b}{2} \), \( \text{Var}(X) = \frac{n^2-1}{12} \)
   - **Bernoulli**: \( E[X] = p \), \( \text{Var}(X) = p(1-p) \)
   - **Binomial**: \( E[X] = np \), \( \text{Var}(X) = np(1-p) \)
   - **Geometric**: \( E[X] = \frac{1}{p} \), \( \text{Var}(X) = \frac{1-p}{p^2} \)
   - **Poisson**: \( E[X] = \lambda \), \( \text{Var}(X) = \lambda \)
   - **Uniform (Continuous)**: \( E[X] = \frac{a+b}{2} \), \( \text{Var}(X) = \frac{(b-a)^2}{12} \)
   - **Exponential**: \( E[X] = \frac{1}{\lambda} \), \( \text{Var}(X) = \frac{1}{\lambda^2} \)
   - **Normal**: \( E[X] = \mu \), \( \text{Var}(X) = \sigma^2 \)
   - **Gamma**: \( E[X] = \frac{\alpha}{\beta} \), \( \text{Var}(X) = \frac{\alpha}{\beta^2} \)
   - **Beta**: \( E[X] = \frac{\alpha}{\alpha + \beta} \), \( \text{Var}(X) = \frac{\alpha \beta}{(\alpha + \beta)^2 (\alpha + \beta + 1)} \)

2. **Markov’s Inequality**
   \[
   P(X \geq c) \leq \frac{\mu}{c}
   \]

3. **Chebyshev’s Inequality**
   \[
   P(|X - \mu| \geq k\sigma) \leq \frac{1}{k^2}
   \]

4. **Binomial Probability**
   \[
   P(X = k) = ^nC_k p^k (1-p)^{n-k}
   \]

5. **Poisson Probability**
   \[
   P(X = k) = \frac{e^{-\lambda} \lambda^k}{k!}
   \]

6. **Normal Distribution PDF**
   \[
   f_X(x) = \frac{1}{\sigma \sqrt{2\pi}} \exp \left( \frac{-(x - \mu)^2}{2\sigma^2} \right)
   \]

7. **Conditional Probability**
   \[
   P(X = x | Y = y) = \frac{P(X = x, Y = y)}{P(Y = y)}
   \]

